original_question:
Dvanajst kvadratov velikosti 1 krat 1 tvori pravokotnik, kot je prikazano. Kolikšna je skupna površina osenčenega območja? [asy]
size(4cm);defaultpen(linewidth(0.75));

// Zapolnjeni deli
fill((0, 4)--(0, 0)--(2, 0)--cycle, gray(0.75));
fill((0, 4)--(3, 4)--(3, 0)--cycle, gray(0.75));

// mreža
int j;
for (j = 0; j < 4; ++j) {draw((j, 0)--(j, 4));}
for (j = 0; j < 5; ++j) {draw((0, j)--(3, j));}

// diagonale
draw((0, 4)--(3, 0)); draw((0, 4)--(2, 0));
[/asy]

